import classes from './Header.module.css';
import images from '../../assets/meals.jpg';


const Header = props => {
    return <>
        <header className={classes.header}>
            <h1>React Meals</h1>
            <button>Cart</button>
        </header>
        <div>
            <img src={images} alt="a table full of delecious food"></img>
        </div>
    </>
}

export default Header;
